import './Menu.css';
//import MenuItem from '../MenuItem';

class Menu extends Component {
  render() { 
    return (
    <div class="col-md-10">
        <nav className="menu">
          <ul className="">
              <li className="">una cosa</li>
              <li className="">dos cosas</li>
          </ul>
        </nav>
    </div>
    );
  }
}

export default Menu;
